import React from 'react';
import Card from './Card';

function CardList({ pets, images }) {

	const defaultPhotos = [];
	images.map((img, i) => {
		if (images[i].defaultPic) {
			defaultPhotos.push(images[i]);
		}
	});

	console.log(defaultPhotos);

	return (
		pets.map((pet, i) => {
				return <Card key={pets[i].id} img={pets[i].img} name={pets[i].name} description={pets[i].description}/>
			}
		)
	)
}

export default CardList;

